INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (7, 2, 0, 0, 5118061, 2834, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", "フリーマーケット会場", 40, 1, "青空の下で謁見", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (7, 2, 0, 0, 5118062, 2835, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", "フリーマーケット会場", 40, 1, "未来の騎空団\nマスコット？", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (7, 2, 0, 0, 5118063, 2837, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", "ランドソル市街地", 40, 1, "お嬢さまからの\n緊急依頼", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 2, 0, 0, 5118064, 4108402, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", "フリーマーケット会場", 40, 1, "黄金色の悩みごと", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 2, 0, 0, 5118065, 4107402, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", "フリーマーケット会場", 40, 1, "白熱！　格闘大会！", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (16, 2, 0, 1, 5118066, 9000227, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", "オーエド町", 40, 1, "祭り太鼓はオーエドの華", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (19, 3, 0, 0, 5118067, 2101181, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", "フリーマーケット会場", 40, 1, "人気者は遅れて\nやってくる", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 3, 0, 0, 5118068, 4109402, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", "ランドソル市街地", 40, 1, "巫女・ミーツ・魔法少女", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 3, 0, 0, 5118069, 4305402, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", "フリーマーケット会場", 40, 1, "ネズ耳は二度なくなる", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 3, 0, 0, 5118070, 4101402, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", "ランドソル市街地", 40, 1, "この出会いにカンパイ！", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (18, 3, 0, 0, 5118071, 4106402, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", "ランドソル市街地", 40, 1, "陰陽アンサンブル", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (7, 3, 0, 1, 5118072, 2836, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", "フリーマーケット会場", 40, 1, "運試し十番勝負！", 91002, 8);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (0, 1, 10145115, 0, 5118600, 0, 10118, 0, "オープニング", 0, 0, 0, "彼女たちの新たな日常", 0, 0);
